import React, {Component} from 'react';

class UngroupedItem extends Component {
    render() {
        const {content} = this.props;
        return (
            <li>
                <svg t="1639238384140" className="icon" viewBox="0 0 1024 1024" version="1.1"
                     xmlns="http://www.w3.org/2000/svg" p-id="2609" width="32" height="32">
                    <path
                        d="M892.064 261.888a31.936 31.936 0 0 0-45.216 1.472L421.664 717.248l-220.448-185.216a32 32 0 1 0-41.152 48.992l243.648 204.704a31.872 31.872 0 0 0 20.576 7.488 31.808 31.808 0 0 0 23.36-10.112L893.536 307.136a32 32 0 0 0-1.472-45.248z"
                        p-id="2806"></path>
                </svg>
                <svg t="1639238503319" className="icon" viewBox="0 0 1024 1024" version="1.1"
                     xmlns="http://www.w3.org/2000/svg" p-id="3655" width="95" height="95">

                </svg>
                <span>
                    {content}
                </span>
                <button
                    style={{display:'none'}}
                >
                    删除
                </button>
            </li>
        );
    }
}

export default UngroupedItem;
